import React from 'react'
import { useHistory } from 'react-router'
import ExploreRight from './ExploreRight'
import ExploreMid from './ExploreMid'
import Links from './Links'
import { useEffect } from 'react'

export default function Explore(props) {
    let history = useHistory();
    useEffect(() => {
        if(!props.loggedInUser){
            console.log("no loggedinusersilly");
            history.push("/");
        }
    })

    return (
        <>
            <div className="col-sm-3 vh-100 pt-1" id="dashboard-col-left">
                <Links loggedInUser={props.loggedInUser}/>
            </div>
            <div className="col-sm-6 p-0" style={{borderLeft: "1px solid rgba(245, 248, 250, .25)", borderRight: "1px solid rgba(245, 248, 250, .25)"}}>
                <ExploreMid loggedInUser={props.loggedInUser}/>
            </div>
            <div className="col-sm-3" id="dashboard-col-right">
                <ExploreRight/>
            </div>
        </>
    )
}
